    return (
        <div className={"container"}>
            <Header text={"ChatRoom"}/>
            <div className={"main"}>
                <ChatList backgroundColor={"tomato"} width={"300px"}>
                    <Header/>
                </ChatList>
                <ChatList backgroundColor={"gold"}/>
            </div>
        </div>
    )
}
